import React from 'react';
import headerImg from '../../media/images/headerImg.jpeg'

const Header = () => {

    return (
        <div>
            <img src={headerImg} alt="Houston Rockets" />
            <h3>Houston Rockets Box Scores</h3>
        </div>
    )
}

export default Header;
